actionConfiguration.body:
() => {

		var ret = []
		if (GetWarehouseMaterialEquipment.data.data != null) {
			var val = GetWarehouseMaterialEquipment.data.data.getEquipment.materialEquipment
			for (let i = 0; i < val.length; i++) {
				let line = {
					"label" : val[i].material.code,
					"value" : val[i].material.id
				}
				ret.push(line)
			}
		}
		return ret
	}

